class SongNode(object):    def __init__(self, current_song=None, next_song=None):        self.current_song = current_song        self.next_song = next_songclass SongList(object):    def __str__(self):        self.head = None    def display(self):        value = self.head        while value:            print(value.current_song)            value = value.next_songsong_list = SongList()song_list.head = SongNode('I love you')second = SongNode('Oh! my darling I love you')third = SongNode("Let me love you")song_list.head.next_song = secondsecond.next_song = thirdsong_list.display()